export default function AdminDashboard() {
  return (


    <React.Fragment>

    <div><h1>AdminDashboard</h1></div>
    <button type="button" className="btn btn-primary btn-lg btn-block"onClick={() => askTheQuery()}>Ask the Query</button>
    <button type="button" className="btn btn-secondary btn-lg btn-block" onClick={() => handleBooking()}>Book the Appointment</button>
    <button type="button" className="btn btn-ordinary btn-lg btn-block" onClick={() => seeAppointmets()}>See Your Appointment</button>

  </React.Fragment>
  )
}
